import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // Importing necessary components
import Login from "./pages/Login"; // Adjust the path to your actual file structure
import Home from "./pages/Home";
import Register from "./pages/Register";
import MedicineAdd from "./pages/MedicineAdd";
import MedicineManage from "./pages/MedicineManage";
import ChangePassword from "./pages/ChangePassword";
p

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/product" element={<Product />} /> {/* Optional: Make this lowercase for consistency */}
          <Route path="/change-password" element={<ChangePassword />} />
          <Route path="/medicine-add" element={<MedicineAdd />} />
          <Route path="/medicine-manage" element={<MedicineManage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
